describe("Footnote relayout validation", () => {
	let editor: DocumentEditor = undefined;
	beforeAll(() => {
		document.body.innerHTML = '';
		let ele: HTMLElement = createElement('div', { id: 'container' });
		document.body.appendChild(ele);
		DocumentEditor.Inject(Editor, Selection, EditorHistory);
		editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true });
		(editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
		(editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
		(editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
		(editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
		editor.appendTo('#container');
		editor.open(JSON.stringify(file));
	});
	afterAll((done) => {
		editor.destroy();
		document.body.removeChild(document.getElementById('container'));
		editor = undefined;
		document.body.innerHTML = '';
		setTimeout(() => {
			done();
		}, 750);
	});
	it('Footnote reference text line layout validation', () => {
		console.log('Footnote reference text line layout validation');
		editor.selection.goToPage(1);
		for (let i = 0; i < editor.documentHelper.pages[0].bodyWidgets[0].childWidgets.length - 1; i++) {
			editor.selection.moveToNextParagraph();
		}
		editor.selection.moveToNextLine();
		editor.selection.moveToLineEnd();
		editor.editor.insertFootnote();
		let bodyWidget: BodyWidget = editor.documentHelper.pages[1].bodyWidgets[0].childWidgets[0] as BodyWidget;
		let paragraph: IWidget = bodyWidget.childWidgets.length as IWidget;
		expect(paragraph).toBe(6);
	});
});